export default {
  name: 'App',
  mounted() {
    this.loadCss('assets/vendor/fontawesome-free/css/all.min.css');
    this.loadScript('assets/vendor/jquery/jquery.min.js');
    this.loadScript('assets/vendor/bootstrap/js/bootstrap.bundle.min.js');
    this.loadScript('assets/vendor/jquery-easing/jquery.easing.min.js');
    this.loadScript('assets/js/sb-admin-2.min.js');
    this.loadScript('assets/vendor/datatables/jquery.dataTables.min.js');
    this.loadScript('assets/vendor/datatables/dataTables.bootstrap4.min.js');
    this.loadScript('assets/js/demo/datatables-demo.js');
  },
  methods: {
    loadCss(url) {
      const link = document.createElement('link');
      link.href = process.env.BASE_URL + url;
      link.type = 'text/css';
      document.head.appendChild(link);
    },
    loadScript(url) {
      const script = document.createElement('script');
      script.src = process.env.BASE_URL + url;
      script.async = false;
      script.type = 'text/javascript';
      document.body.appendChild(script);
    }
  }
};
